import {goBack} from './update_state/UpdateState'



export  const funcName = () => {
    console.log('funcName()')
}




export const test = () => {
    console.log('modules -> Tracker.test(): STARTED')
    console.log('modules -> Tracker.test(): FINISHED')
}


/*
export const goBack = (request, state) => {
    console.log('modules -> Tracker.goBack(): STARTED')
    console.log(request)
    console.log(state)
    console.log('modules -> Tracker.goBack(): FINISHED')
}
*/


export const updateState = (request, state) => {
    console.log('modules -> Tracker.updateState(): STARTED')
    console.log(request)
    console.log(state)

    if (request.command === 'go-back') {
        console.log('command === go-back')

        goBack(request.location)

        if (location === ['Tracker']){
            console.log('Tracker')
        }


    }


    for (let i=0; i<request.location.length; i++) {
        console.log(request.location[i])

        if (request.location[i] === 'Tracker'){
            console.log('Tracker')

            if (request.location.length === 1) {
                console.log('request length = 1')
            }


        }

        if (request.location.location[i] === 'Navigator') {
            console.log('Navigator')

            if (request.location.length === 2){
                console.log('request length = 2')
            }
        }
    }



    console.log('modules -> Tracker.updateState(): FINISHED')

    return state;
}
